let CURRENT_SET_ID = 'sv3pt5';
let CARD_SET = PACK_DATA[CURRENT_SET_ID].info;
let CARDS = PACK_DATA[CURRENT_SET_ID].cards;
let MAX_IMAGE_ID = CARD_SET.maxImageId;

function changeSet(setId) {
  if (PACK_DATA[setId]) {
    CURRENT_SET_ID = setId;
    CARD_SET = PACK_DATA[setId].info;
    CARDS = PACK_DATA[setId].cards;
    MAX_IMAGE_ID = CARD_SET.maxImageId;
    return true;
  }
  return false;
}

function getCardImageUrl(cardId, size, setId) {
  setId = setId || CURRENT_SET_ID;
  size = size || 400;
  var setCards = PACK_DATA[setId] && PACK_DATA[setId].cards;
  if (!setCards) return "/assets/cards/SD1/001.svg";
  var card = setCards.find(function(c) { return c.id === cardId; });
  if (card) {
    if (size >= 600 && card.imageLarge) return card.imageLarge;
    if (card.imageSmall) return card.imageSmall;
  }
  return "/assets/cards/SD1/" + String(cardId).padStart(3, "0") + ".svg";
}

